import React from "react";
import logo from "../assets/images/Tlogo.png";
import logo1 from "../assets/images/bpurple.png";
import {
  FaFacebookF,
  FaLinkedinIn,
  FaTwitter,
  FaYoutube,
} from "react-icons/fa";

const Partners = () => {
  return (
    <div className="py-2 h-28 bg-purple">
      <div>
        <div className="flex flex-col">
          <div className="md:flex md:justify-center items-center px-6 md:my-4">
            <div>
              <img
                className=" w-[125px] h-[35px] items-center justify-center px-6 mx-6"
                src={logo}
                alt="logo"
              />
            </div>
            <div>
              <img
                className=" w-[125px] h-[35px]items-center justify-center px-6 mx-6"
                src={logo1}
                alt="logo"
              />
            </div>
            <div>
              <img
                className=" w-[125px] h-[35px] items-center justify-center px-6 mx-6"
                src={logo}
                alt="logo"
              />
            </div>

            <div>
              <img
                className=" w-[125px] h-[35px] items-center justify-center px-6 mx-6"
                src={logo}
                alt="logo"
              />
            </div>
            <div>
              <img
                className=" w-[125px] h-[35px] items-center justify-center px-6 mx-6"
                src={logo}
                alt="logo"
              />
            </div>

          </div>

        </div>
      </div>
    </div>
  );
};

export default Partners;
